--=================================================
-- ANGAMING IOROID - UIFullHub
-- Giao diện Tabs + Nút tải "Core đầy đủ" (giữ toàn bộ tính năng gốc, đã đổi brand)
-- Nếu bạn muốn map từng chức năng vào từng tab cụ thể, cần có source không obfuscate.
--=================================================

local HttpGet = (syn and syn.request) and (function(url) return game:HttpGet(url) end) or game.HttpGet

-- Tải thư viện UI (Kavo-UI). Nếu thất bại sẽ fallback sang UI đơn giản.
local ok, Library = pcall(function()
    return loadstring(game:HttpGet("https://raw.githubusercontent.com/xHeptc/Kavo-UI-Library/main/source.lua"))()
end)

local Window, UsingFallback

if ok and Library and type(Library.CreateLib) == "function" then
    Window = Library.CreateLib("ANGAMING IOROID - Hub", "Ocean")
else
    UsingFallback = true
    -- Fallback UI rất đơn giản (print-based) nếu không lấy được Kavo
    warn("[ANGAMING IOROID] Không tải được Kavo-UI. Dùng fallback UI.")
end

--============================
-- Tạo Tabs khi có Kavo-UI
--============================
local Tabs = { }
local function NewTab(name)
    if UsingFallback then return nil end
    local tab = Window:NewTab(name)
    Tabs[name] = tab
    return tab
end

local function NewSection(tabName, sectionName)
    if UsingFallback then return nil end
    local tab = Tabs[tabName] or NewTab(tabName)
    return tab:NewSection(sectionName or tabName)
end

-- Core Tab
if not UsingFallback then
    local CoreTab = NewTab("Core")
    local CoreSec = NewSection("Core", "Bộ máy chính")
    CoreSec:NewLabel("ANGAMING IOROID - Full Features")
    CoreSec:NewParagraph("Giữ nguyên toàn bộ chức năng", "Nhấn nút dưới để nạp Core đầy đủ (đã đổi thương hiệu).")
end

