local function StartFullCore()
    local ok_core, err = pcall(function()
        local fn = loadstring(ANGAMING_IOROID_CORE)
        if fn then fn() end
    end)
    if not ok_core then
        warn("[ANGAMING IOROID] Lỗi khi chạy Core:", err)
    end
end

-- Nút khởi chạy Core (UI)
if not UsingFallback then
    local CoreTab = Tabs["Core"]
    local CoreSec = NewSection("Core", "Khởi chạy")
    CoreSec:NewButton("Load ANGAMING IOROID Full Core", "Nạp toàn bộ chức năng gốc (đã đổi brand).", function()
        StartFullCore()
    end)
end

--=================================================
-- Các Tab bổ sung để mở rộng sau này (Auto Farm / Combat / Event / Misc)
-- Lưu ý: vì core gốc đang bị obfuscate, khó thể nối trực tiếp từng hàm.
-- Bạn có thể thêm chức năng mới của riêng bạn vào các toggle bên dưới.
--=================================================

if not UsingFallback then
    -- Auto Farm
    do
        local Tab = NewTab("Auto Farm")
        local Sec = NewSection("Auto Farm", "Tùy chỉnh mới")
        Sec:NewToggle("Auto Farm (New Layer)", "Tầng tự viết thêm, không ảnh hưởng Core.", function(state)
            getgenv().ANGI_AutoFarm = state
            if state then
                task.spawn(function()
                    while getgenv().ANGI_AutoFarm do
                        task.wait(1)
                        -- TODO: Thêm code farm riêng tại đây
                    end
                end)
            end
        end)
    end

    -- Combat
    do
        local Tab = NewTab("Combat")
        local Sec = NewSection("Combat", "Tùy chỉnh mới")
        Sec:NewToggle("Aimbot (New Layer)", "Tầng tự viết thêm, không ảnh hưởng Core.", function(state)
            getgenv().ANGI_Aimbot = state
            -- TODO: Thêm code aimbot riêng (nếu muốn)
        end)
    end

    -- Event
    do
        local Tab = NewTab("Event")
        local Sec = NewSection("Event", "Tùy chỉnh mới")
        Sec:NewToggle("Auto Event (New Layer)", "Tầng tự viết thêm, không ảnh hưởng Core.", function(state)
            getgenv().ANGI_Event = state
            -- TODO: Thêm code event riêng
        end)
    end

    -- Misc
    do
        local Tab = NewTab("Misc")
        local Sec = NewSection("Misc", "Chung")
        Sec:NewButton("Redeem All Codes (New Layer)", "Chạy redeem code của riêng bạn (không phải từ core).", function()
            -- TODO: Thêm code redeem của bạn
            print("[ANGAMING IOROID] Redeem (new layer) đã chạy")
        end)
    end

    -- Credits
    do
        local Tab = NewTab("Credits")
        local Sec = NewSection("Credits", "Thông tin")
        Sec:NewLabel("Made by ANGAMING IOROID")
        Sec:NewLabel("UIFullHub = UI Tabs + Full Core")
    end
else
    -- Fallback chế độ không UI: chạy core ngay
    print("[ANGAMING IOROID] Fallback mode: Đang nạp Full Core...")
    StartFullCore()
end
